import React from "react";

const TransactionList = () => {
  return (
      <>
        <h3>History</h3>
        <ul id="list" className="list">
            <li className="minus">
                Cash <span>-&#x20b9;400</span>
                <button className="delete-btn">x</button>
            </li>
            <li className="plus">
                Cash <span>+&#x20b9;400</span>
                <button className="delete-btn">x</button>
            </li>
        </ul>
      </>
  )
};

export default TransactionList;
